#set values of A,T,G,C
A=0
T=0
G=0
C=0


#Add DNA input
dna=''




#look for A and add to A value
x='A'
for i in range (0,len(dna)):
    if dna[i]==x:
        A=A+1
        
        
#look for T and add to T value        
x='T'      
for i in range (0,len(dna)):
    if dna[i]==x:
        T=T+1
        
        
        
#look for G and add to G value                
x='G'      
for i in range (0,len(dna)):
    if dna[i]==x:
        G=G+1
        
        
#look for C and add to C value          
x='C'      
for i in range (0,len(dna)):
    if dna[i]==x:
        C=C+1
        
        
#Print A,T,G,C        
print (A)
print (T)
print (G)    
print (C)